  true,\n\t\"url\": null,\n\t\"notes\": \"<p>1991-2015. High School Dataset. The Youth
  Risk Behavior Surveillance System (YRBSS) monitors six categories of priority health
  behaviors namong youth and young adults: 1) behaviors that contribute to unintentional
  injuries and violence; 2) tobacco use; 3) alcohol and nother drug use; 4) sexual
  behaviors related to unintended pregnancy and sexually transmitted infections (STIs),
  including human nimmunodeficiency virus (HIV) infection; 5) unhealthy dietary behaviors;
  and 6) physical inactivity. In addition, YRBSS monitors nthe prevalence of obesity
  and asthma and other priority health behaviors.</p>n\",\n\t\"license_title\": \"Other
